import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate, useParams } from 'react-router-dom';

const EditFilm = () => {
    const { id } = useParams();
    const [film, setFilm] = useState(null);
    const [updatedFilm, setUpdatedFilm] = useState({
        title: '',
        director: '',
        durationMinutes: 0,
        watched: false,
        releaseDate: '',
        rating: 0.0,
        popularity: 0.0,
    });

    const navigate = useNavigate();

    useEffect(() => {
        const fetchFilm = async () => {
            try {
                const response = await axios.get(`http://localhost:8080/films/${id}`);
                setFilm(response.data);
                setUpdatedFilm(response.data);
            } catch (error) {
                console.error('Błąd podczas pobierania filmu', error);
            }
        };

        fetchFilm();
    }, [id]);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setUpdatedFilm((prevFilm) => ({
            ...prevFilm,
            [name]: value,
        }));
    };

    const updateFilm = async (e) => {
        e.preventDefault();
        try {
            await axios.put(`http://localhost:8080/films/${id}`, updatedFilm);
            navigate('/'); // Po edytowaniu filmu wracamy na stronę główną (FilmList)
        } catch (error) {
            console.error('Błąd podczas edytowania filmu', error);
        }
    };

    if (!film) {
        return <div>Ładowanie filmu...</div>;
    }

    return (
        <div>
            <h2>Edytuj Film</h2>
            <form onSubmit={updateFilm}>
                <label>
                    Tytuł:
                    <input
                        type="text"
                        name="title"
                        value={updatedFilm.title}
                        onChange={handleInputChange}
                        required
                    />
                </label>
                <br />
                <label>
                    Reżyser:
                    <input
                        type="text"
                        name="director"
                        value={updatedFilm.director}
                        onChange={handleInputChange}
                        required
                    />
                </label>
                <br />
                <label>
                    Czas trwania (minuty):
                    <input
                        type="number"
                        name="durationMinutes"
                        value={updatedFilm.durationMinutes}
                        onChange={handleInputChange}
                        required
                    />
                </label>
                <br />
                <label>
                    Obejrzany:
                    <input
                        type="checkbox"
                        name="watched"
                        checked={updatedFilm.watched}
                        onChange={(e) =>
                            setUpdatedFilm((prev) => ({
                                ...prev,
                                watched: e.target.checked,
                            }))
                        }
                    />
                </label>
                <br />
                <label>
                    Data wydania:
                    <input
                        type="date"
                        name="releaseDate"
                        value={updatedFilm.releaseDate}
                        onChange={handleInputChange}
                        required
                    />
                </label>
                <br />
                <label>
                    Ocena:
                    <input
                        type="number"
                        name="rating"
                        value={updatedFilm.rating}
                        onChange={handleInputChange}
                        step="0.1"
                        min="0"
                        max="10"
                        required
                    />
                </label>
                <br />
                <label>
                    Popularność:
                    <input
                        type="number"
                        name="popularity"
                        value={updatedFilm.popularity}
                        onChange={handleInputChange}
                        step="0.1"
                        min="0"
                        required
                    />
                </label>
                <br />
                <button type="submit">Zapisz zmiany</button>
            </form>
        </div>
    );
};

export default EditFilm;
